import React from 'react';
import CursoBasico from '../components/eneagrama/curso/CursoBasico';

const Curso = () => {
    return (
        <div className="cursos-page">
            <h1>Cursos de Eneagrama</h1>
            <div id="curso-basico">
                <CursoBasico />
            </div>
        </div>
    );
};

export default Curso;
